import React from "react";
import ProjectCard from "../components/ProjectCard";
import "../styles/Projects.css";

function Projects() {
  return (
    <section className="projects" id="projects">
      <h2>My Projects</h2>
      <div className="project-list">
        <ProjectCard
          title="Dream Portfolio"
          description="A soft pastel React portfolio with elegant UI and animations."
        />
        <ProjectCard
          title="Khareedgar"
          description="A sleek e-commerce store made with ShadCN UI & custom styling."
        />
        <ProjectCard
          title="AI Chatbot UI"
          description="A chatbot interface with typing animation and CSS effects."
        />
      </div>
    </section>
  );
}

export default Projects;
